window.bookSummaryJSON = "<p><b><i>Last of Us</i></b><b> meets </b><b><i>The Walking Dead</i></b><b> in this post apocalyptic story. Perfect for fans of </b><b><i>The Cascadia Series</i></b><b>, and </b><b><i>Until The End Of The World</i></b><b> by Sarah Lyons Fleming.</b></p> <p><b>A deadly infection. Seven Strangers. The fight for survival begins...</b></p> <p>Jake didn't think his night could get worse, but that was before his train stops deep underground and zombies attack and things go from worst-day-ever to run-for-your-life terror.</p> <p>Liv is good at running, mostly from other people straight into a bottle of vodka. But as chaos erupts on the city streets, depending on others may be her only chance at survival.</p> <p>London is gone. The world has ended. In the chaos that remains, seven strangers fight to escape the city. But as they navigate this new and dangerous world, they soon discover that surviving the apocalypse means confronting their deepest fears and making impossible choices.</p> <p><i>How We End </i>is a heart-pounding diverse story with a character driven plot that explores how societal collapse forces ordinary people into extreme situations and reveals the lengths they'll go to survive in a world gone mad. Will they make it out alive, or will they become just another casualty?</p> <p>\"The <i>How We Survive</i> series is zombies with <b>a cool twist and real characters you root for</b>. LM Juniper shoves you into the action while also tugging on your heartstrings.\" - Sarah Lyons Fleming, Author of <i>Until The End of The World </i>Series</p>"; 
